import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/PowerSupplyPage.css'; // Import the CSS file

const powerSupplyData = [
  { id: '67ff0e15173e97a1a082e4b2', name: 'Corsair HX1500i', image: 'data:image/jpeg;base64,', slug: 'corsair-hx1500i' },
  { id: '67ff0e15173e97a1a082e4b3', name: 'Seasonic PRIME TX-1600', image: 'data:image/jpeg;base64,', slug: 'seasonic-prime-tx-1600' },
  { id: '67ff0e15173e97a1a082e4b4', name: 'EVGA SuperNOVA 1600 T2', image: 'data:image/jpeg;base64,', slug: 'evga-supernova-1600-t2' },
  { id: '67ff0e15173e97a1a082e4b5', name: 'be quiet! Dark Power Pro 13 1300W', image: 'data:image/jpeg;base64,', slug: 'be-quiet-dark-power-pro-13-1300w' },
  { id: '67ff0e15173e97a1a082e4b6', name: 'Cooler Master X Silent 850', image: 'data:image/jpeg;base64,', slug: 'cooler-master-x-silent-850' },

];

const PowerSupplyPage = () => {
  return (
    <div className="power-supply-page">
      <h2>Browse Power Supplies</h2>
      <div className="power-supply-grid">
        {powerSupplyData.map((psu) => (
          <Link to={`/product/${psu.id}`} key={psu.id} className="power-supply-card">
            <img src={psu.image} alt={psu.name} />
            <h3>{psu.name}</h3>
          </Link>
        ))}
      </div>
    </div>
  );
};

export default PowerSupplyPage;
